import React, { useState } from 'react';
import { FiMail, FiPhone, FiMapPin, FiLinkedin, FiGithub, FiTwitter, FiSend, FiCheck, FiClock } from 'react-icons/fi';

export default function Contact() {
  const [form, setForm] = useState({name:'',email:'',subject:'',message:''});
  const [status, setStatus] = useState('idle'); // idle, sending, sent

  const info = [
    {icon:FiMail,label:'Email',value:'john.smith@example.com',link:'mailto:john.smith@example.com'},
    {icon:FiPhone,label:'Phone',value:'+1 (555) 123-4567',link:'tel:+15551234567'},
    {icon:FiMapPin,label:'Location',value:'New York, NY',link:'https://maps.google.com/?q=New+York,NY'}
  ];

  const socials = [
    {icon:FiGithub,label:'GitHub',url:'https://github.com/johnsmith'},
    {icon:FiLinkedin,label:'LinkedIn',url:'https://linkedin.com/in/johnsmith'},
    {icon:FiTwitter,label:'Twitter',url:'https://twitter.com/johnsmith'},
  ];

  const handleChange=e=>setForm({...form,[e.target.name]:e.target.value});
  const handleSubmit=e=>{
    e.preventDefault();
    setStatus('sending');
    setTimeout(()=>{
      console.log(form);
      setStatus('sent');
      setForm({name:'',email:'',subject:'',message:''});
      setTimeout(()=>setStatus('idle'),5000);
    },1500);
  };

  const getIcon=()=>{
    if(status==='sending') return <FiClock className="animate-spin"/>;
    if(status==='sent') return <FiCheck/>;
    return <FiSend/>;
  };
  const getText={'idle':'Send Message','sending':'Sending...','sent':'Message Sent!'}[status];

  return (
    <section id="contact" className="section-padding bg-gray-50 dark:bg-gray-800/50">
      <div className="container-custom">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold mb-6 animate-fadeInUp">Get In Touch</h2>
        </div>
        <div className="grid lg:grid-cols-2 gap-16">
          <div className="animate-fadeInLeft space-y-6">
            <h3 className="text-2xl font-bold">Let's Talk</h3>
            <p className="text-gray-600 dark:text-gray-300 leading-relaxed">
              Available for freelance work and full-time opportunities.
            </p>
            {info.map((i,idx)=>(
              <a key={idx} href={i.link} className="flex items-center p-4 bg-white dark:bg-gray-800 rounded-lg shadow-sm hover:shadow-md transition">
                <i.icon className="w-12 h-12 bg-primary-100 text-primary-600 p-3 rounded-lg mr-4"/>
                <div>
                  <div className="font-medium text-gray-900 dark:text-gray-100">{i.label}</div>
                  <div className="text-gray-600 dark:text-gray-300 text-sm">{i.value}</div>
                </div>
              </a>
            ))}
            <h4 className="font-semibold">Follow me on</h4>
            <div className="flex space-x-4">
              {socials.map((s,idx)=>(
                <a key={idx} href={s.url} className="w-12 h-12 bg-white dark:bg-gray-800 rounded-lg flex items-center justify-center shadow-sm hover:shadow-md transform hover:scale-110 transition">
                  <s.icon className="w-6 h-6 text-gray-600 dark:text-gray-400"/>
                </a>
              ))}
            </div>
          </div>
          <div className="animate-fadeInRight">
            <div className="card p-8">
              <h3 className="text-2xl font-bold mb-6">Send Message</h3>
              <form onSubmit={handleSubmit} className="space-y-6">
                <div className="grid md:grid-cols-2 gap-6">
                  <div>
                    <label htmlFor="name" className="block text-sm font-medium mb-2">Your Name *</label>
                    <input type="text" id="name" name="name" value={form.name} onChange={handleChange} required className="form-input"/>
                  </div>
                  <div>
                    <label htmlFor="email" className="block text-sm font-medium mb-2">Your Email *</label>
                    <input type="email" id="email" name="email" value={form.email} onChange={handleChange} required className="form-input"/>
                  </div>
                </div>
                <div>
                  <label htmlFor="subject" className="block text-sm font-medium mb-2">Subject *</label>
                  <input type="text" id="subject" name="subject" value={form.subject} onChange={handleChange} required className="form-input"/>
                </div>
                <div>
                  <label htmlFor="message" className="block text-sm font-medium mb-2">Message *</label>
                  <textarea id="message" name="message" rows="4" value={form.message} onChange={handleChange} required className="form-textarea"/>
                </div>
                <button type="submit" disabled={status==='sending'} className={`w-full btn-primary flex items-center justify-center ${status==='sent'?'bg-green-600 hover:bg-green-700':''}`}>
                  <span className="mr-2">{getIcon()}</span>{getText}
                </button>
              </form>
              {status==='sent' && (
                <div className="mt-6 p-4 bg-green-100 text-green-700 rounded-lg flex items-center">
                  <FiCheck className="mr-2"/> Thank you! I'll get back to you soon.
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
